import React from 'react';

const book=({book})=> {
      const {ISBN,Bookname,Author,category,Price,imgUrl} = book;
      return <article className='menu-item'>
            <img src={imgUrl} alt={Bookname} className='photo'/>
            <h3>{Bookname}</h3>
            <h4 className='price'>${Price}</h4>
            <h4>{Author}</h4>
      </article>
}

export default book;
